import { Component, OnInit } from '@angular/core';
import { Chart,registerables } from 'node_modules/chart.js';
import { Patient } from 'src/app/Models/Patient';
import { HttpService } from 'src/app/Services/http.service';
Chart.register(...registerables)

@Component({
  selector: 'app-dashboard',
  templateUrl: './dashboard.component.html',
  styleUrls: ['./dashboard.component.css']
})
export class DashboardComponent implements OnInit{
  nb:number;
  nbrdv:number;
  total:number=0;
  prix:number=0;
  patients:Patient[];
   patientNombre: number[]
  ;
  constructor(private http:HttpService ){


    this.http.getNombrePatient().subscribe((res:number[])=>{
      if (res !== null && res !== undefined) {
        this.patientNombre=(res);
        console.log(this.patientNombre)

      }      
});
console.log(this.patientNombre) 
  }
  getnbpat(){

      this.http.getPatientByCab(this.http.md.nom_cabinet).subscribe((result: any)=>{

        this.nb=result;

                  });


  }
  gettotal(){



        this.http.getPatientsCabinet(this.http.md.nom_cabinet).subscribe((result: any)=>{



          this.patients.forEach(element => {

            this.http.sumtotale(element.cin).subscribe((hh: any)=>{
              console.log(element);

              this.prix=hh;
              this.total=this.total+this.prix;
              console.log(this.prix);

                        });



          });

                    });





}
  getnbrdv(){

    this.http.getRdvByCab(this.http.md.cin).subscribe((result: any)=>{

      this.nbrdv=result;

                });

}

  title = 'frontcab';
  ngOnInit(): void{
    this.getnbrdv();

    this.getnbpat();
    this.RenderChart();
    this.otherChart();
    console.log(this.patientNombre)

  }
  RenderChart(){

    const myChart = new Chart("myChart",{
      type:'bar',
      data:{
        labels:['red','blue','yellow','green','purple','orange'],
        datasets: [{
          label: 'Patients',
          data:[12,19,3,5,2,3],
          backgroundColor:[
            'rgb(255,69,0) ',
            'rgb(255,69,0) ',
            'rgb(255,69,0) ',
            'rgb(255,69,0) ',
            'rgb(255,69,0) ',
            'rgb(255,69,0) ',
          ],
          borderColor:[
            'rgb(255,69,0) ',
            'rgb(255,69,0) ',
            'rgb(255,69,0) ',
            'rgb(255,69,0) ',
            'rgb(255,69,0) ',
            'rgb(255,69,0) ',
          ],
          borderWidth:1
        }]
      },
      options:{
        scales:{
          y:{
            beginAtZero: true
          }
        }
      }
    });
  }


  otherChart(){
//console.log(this.patientNombre)
    const myChart = new Chart("otherChart",{
      type:'line',
      data:{
        labels:['Jan','Fev','Mars','Avril','Mai','Juin','Juil','Aout','Sept','Oct','Nov','Dec'],
        datasets: [{
          label: 'caisse',
          data:this.patientNombre,

          backgroundColor:[
            '#0000FF',
            '#0000FF ',
            '#0000FF ',
            '#0000FF',
            '#0000FF',
            '#0000FF',
          ],
          borderColor:[
            '#0000FF',
            '#0000FF ',
            '#0000FF ',
            '#0000FF',
            '#0000FF',
            '#0000FF',
          ],
          borderWidth:1
        }]
      },
      options:{
        scales:{
          y:{
            beginAtZero: true
          }
        }
      }
    });
  }
}
